import React from 'react';
import './App.css';
import Pokemons from './data';
import ListPokemons from './ListPokemons'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <ListPokemons pokemons = {Pokemons}/>
      </header>
    </div>
  );
}

export default App;
